import axios from "axios"
import { useState } from "react";
import { getapi } from "../constant"

const getResource = ()=>{
  let resp="";  
  resp = fetch(getapi)
  .then(response => response.json())
  .then(data => console.log(data));
  // console.log(resp)
  return resp;

}
export default getResource;
